import InputCheckOut from '@components/input-checkout';
import React from 'react';

const FormCheckOut = () => {
    return (
        <div>
            <div>

                <h1 className='text-[36px]'>Billing Details</h1>
                <InputCheckOut name='First Name' type='text' id='firstname' ></InputCheckOut>
                <InputCheckOut name='Company Name' type='text' id='companyname' ></InputCheckOut>
                <InputCheckOut name='Street Address' type='text' id='streetaddress' ></InputCheckOut>
                <InputCheckOut name='Apartment, floor, etc. (optional)' type='text' id='info' ></InputCheckOut>
                <InputCheckOut name='Town/City' type='text' id='address' ></InputCheckOut>
                <InputCheckOut name='Phone Number' type='phone' id='phone' ></InputCheckOut>
                <InputCheckOut name='Email Address' type='email' id='email' ></InputCheckOut>
            </div>
        </div>
    );
};

export default FormCheckOut;
